import React from 'react';
import ReactDOM from 'react-dom';
import Nav,{Card} from "./cards";
import Arr from "./cardsarr";

ReactDOM.render(<>
    <Nav/>
    <div className="ashu">
    <Card imgsrc={Arr[0].imgsrc} link={Arr[0].link} name={Arr[0].name}/>
    <Card imgsrc={Arr[1].imgsrc} link={Arr[1].link} name={Arr[1].name}/>
    <Card imgsrc={Arr[2].imgsrc} link={Arr[2].link} name={Arr[2].name}/>
    <Card imgsrc={Arr[3].imgsrc} link={Arr[3].link} name={Arr[3].name}/>
    <Card imgsrc={Arr[3].imgsrc} link={Arr[3].link} name={Arr[3].name}/>




    </div>
    </>,document.getElementById("root"));

